column13:
A flat panel display comprising: 
a faceplate structure; 
a backplate structure having an electron emitting structure; 
a focusing structure having a first surface coupled to the electron emitting structure and a second surface which extends away from the electron emitting structure, the focusing structure and the electron emitting structure having an electrical end between the first and second surfaces of the focusing structure; 
a spacer located between the focusing structure and the faceplate structure, the spacer having an electrical end located above the electrical end of the focusing structure and the electron emitting structure; 
a face electrode located an a face surface of the spacer; and 

means for controlling the voltage of the face electrode to create, adjacent to the face electrode, a voltage distribution which compensates for the voltage distribution caused by the electrical end of the spacer being located above the electrical end of the focusing structure and the electron emitting structure, the controlling means comprising (a) a first edge electrode located at a first edge surface of the spacers, extending along only part of the first edge surface, and contacting the backplate structure and (b) a second edge electrode located at a second edge suface of the spacer and contacting the faceplate structure.

